import React from "react";
import { Container, Navbar, Nav } from "react-bootstrap";

const ProjectHeader = () => {
  return (
    <>
      <Navbar expand="lg" bg="light">
        <Container>
          <Nav.Link>Dashoard : Products</Nav.Link>
        </Container>
      </Navbar>
    </>
  );
};

export default ProjectHeader;
